import React from 'react'
import Image1 from "../../assets/meals.jpg"
import classes from "./Header.module.css";

const Header = (props) => {
    return (
        <React.Fragment>
            <header className={classes.header}>
                <h1>ReactMeals</h1>
                <button>Cart</button>
            </header>
            <div className={classes.mainI}>
                <img
                    scr={Image1} />
                    alt="A table full of meals"
            </div>
        </React.Fragment>
            
    )
}
export default Header;
